import { IconButton } from "@mui/material";
import { AppbarContainer } from "../../styles/appbar";
import MenuIcon from '@mui/icons-material/Menu';

export default function AppbarMobile({matches}){

    return(
        <AppbarContainer>
            <IconButton>
                <MenuIcon/>

            </IconButton>
        </AppbarContainer>
    );
};
